import React from 'react';
import { ThemeProvider, createTheme } from '@mui/material';
import CGPACalculator from './components/CGPACalculator';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2',
    },
    secondary: {
      main: '#dc004e',
    },
  },
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <CGPACalculator />
    </ThemeProvider>
  );
}

export default App;
